text:
@TinaCert it’s extremely troubling to see you call a murdered husband and father an “uneducated white boy” and his memorial service a “Drump rally.” Referring to anyone as an “uneducated white boy” is not only racially charged but also divisive. 

It’s clear that you view my family or any family that doesn’t share your political views, through the lens of hate. 

As a parent in this district, I expect our school leaders to set a positive example for our kids. You have chosen hate, division and political bias instead and for that you should resign.
